// src/components/EditorManagement.js
import React from 'react';


const EditorManagement = ({ onAddEditor, onRemoveEditor, onViewEditors, onBack }) => (
  <div className="editor-management">
    <h2>Manage Editors</h2>
    <div className="button-group">
      <button className="btn btn-add" onClick={onAddEditor}>Add Editor</button>
      <button className="btn btn-remove" onClick={onRemoveEditor}>Remove Editor</button>
      <button className="btn btn-view" onClick={onViewEditors}>View Editors</button>
      <button className="btn btn-back" onClick={onBack}>Back to Admin Options</button>
    </div>
  </div>
);

export default EditorManagement;
